const e = createEngine(gameCanvas, 300, 300);

e.addText("hopping rockets!?! launching bunnies!?!", 158, 90)
e.addText("heldKey vs. pressedKey", 150, 106);

/* BEGIN BUNNY */
e.add({
  sprite: bunny,
  x: 240,
  y: 166,
  origin: [0.5, 0.5],
  scale: 4,
  solid: true,
  update(me) {
    me.vy += 80;
    if (e.heldKey(' ')) {
      me.vy -= 100;
    }

    if (me.vy < 0) {
      me.sprite = bunny_jump;
    } else {
      me.sprite = bunny;
    }
  }
});
/* END BUNNY */

/* BEGIN TILES */
e.add({ sprite: tile, scale: 4, solid: true, y: 246, x: 171 });
e.add({ sprite: tile, scale: 4, solid: true, y: 246, x:   1 });
/* END TILES */

/* BEGIN ROCKET */
e.add({
  sprite: rocket,
  x: 67,
  y: 166,
  origin: [0.5, 0.5],
  scale: 4,
  solid: true,
  update(me) {
    me.vy += 50;
    if (e.pressedKey(' ')) {
      me.vy -= 500;
    }

    if (me.vy < 0) {
      me.sprite = rocket_go;
    } else {
      me.sprite = rocket;
    }
  }
});
/* END ROCKET */

e.start();

/* ART CREDITS:
  - bunny and rocket by Cedric Hutchings
  - tile by Dylan MacGillavry
*/
